🌞 Autodescrise într-un cuvânt? Entuziasmată și “NU”, sau Tammy și Wanda. Două energii care par transpuse la granițe diferite ale spectrului personalităților, dar care fuzionează prin mixuri de stiluri pentru regenerarea urbană a Ploieștiului. 

@wanda.direct este full time artistă muralistă în continuă schimbare, care transpune adevărul ei, „not everything you lose is a loss”, prin abordarea prin artă a subiectelor cu impact pentru societate, fără a-și impune un stil anume prin tehnici sau lucrări repetate la nesfârșit. Și-a început relația cu muralele în 2017, iar în următorii 5 ani, această formă de exprimare a devenit principalul mijloc de exprimare a ideilor, conceptelor și gândurilor sale. ea își expune valorile în proiectele conturate prin mesaje sociale, fie ele despre mediu, nedreptatea din societatea noastră, mentalitatea oamenilor sau alte subiecte care transced limitele individuale. NU a urmărit să-și creeze un stil recognoscibil, dimpotrivă, vrea ca fiecare lucrare să fie unică. Chiar dacă este de părere că toate lucrările sale puse cap la cap NU vor schimba prea multe în societatea în care trăim, speră că vor schimba totuși unele minți. 

@tammylovin_  este artistă digitală și specialistă în tehnologii emergente, precum AR, VR, XR, arta programabilă sau A.I art, dar si NFT. Simultan Tammy dezvoltă proiecte de tip virtual fashion și este arhitect în Metaverse. Lucrările sale eye-candy concepute pe baza adevărului său, „entuziasmul este cheia” au fost expuse în multiple galerii internaționale din Miami, L.A., Beijing, dar și pe ecranele uriașe din Times Square NYC, fiind prima artistă din România în acest domeniu care se bucură de o așa recunoaștere extinsă la nivel global. Este frecvent invitată ca speaker specialist la conferințe internaționale și își continuă ascensiunea și pe social media prin video-uri educative și tutoriale în zona de web3.

